import React from "react";
import Card from '@material-ui/core/Card';
let Content=()=>{

    return(
        <>
        <Card className="content">
        <input type="text" placeholder="Title.."/>
        <textarea rows="5" cols="10" placeholder="write something..">

        </textarea>
        </Card>
        </>
    )
}

export default Content;
